import React, { useEffect } from 'react'
import styles from './Home.module.css';
import Logo from '../../assets/logo.png';
import NavList from '../../components/navigation/NavList';
import Card from '../../components/util/Card';
import AddFriendList from '../../components/friend/AddFriendList';
import Header from '../../components/header/Header';
import Status from '../../components/home/Status';
import { useDispatch, useSelector } from 'react-redux';
import {getPosts} from '../../store/actions/postAction';
import PostCard from '../../components/post/PostCard';

export default function Home() {
    const dispatch = useDispatch();
    const {auth, post} = useSelector(state=>state);

    useEffect(()=>{
        dispatch(getPosts(auth));
    },[auth])

    return (
        <>
            <Header/>
            <div className={styles.content}>
                <div className={styles.container}>
                    <div className={styles.leftside}>
                        <div className={styles.nav_list_wrapper}><NavList/></div>
                        
                    </div>
                    <div className={styles.container_2}>
                        <div className={styles.middle}>
                            <Status/>
                            {post && post.posts.map(post=>(
                                <PostCard key={post._id} post={post} />
                            ))}
                        </div>
                        <div className={styles.rightside}>
                            <Card width={'100%'} height={'100%'}>
                                <div className={styles.img_wrapper}>
                                    <img src={Logo} />
                                </div>
                                <div className={styles.body_wrapper}>
                                    <div className="title">This is title</div>
                                    <p>Doggo</p>
                                </div>
                            </Card>
                            <Card width={'100%'} height={'100%'}>
                                <div className="title">People you may know</div>
                                <AddFriendList/>
                            </Card>
                            <Card width={'100%'} height={'100%'}>
                                
                            </Card>
                            
                        </div>
                        </div>
                </div>
            </div>
        </>
    )
}
